// Segmentation.js

import React, { useEffect, useState } from 'react';
import { fetchSegmentationResults } from '../utils/api';

const Segmentation = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const result = await fetchSegmentationResults();
      setData(result);
    };
    fetchData();
  }, []);

  return (
    <div>
      <h2>Instagram User Segmentation</h2>
      <table>
        <thead>
          <tr>
            <th>Username</th>
            <th>Segment</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item.username}>
              <td>{item.username}</td>
              <td>{item.segment}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Segmentation;
